import React from "react";

function Attribute(props) {
    return (
        <React.Fragment>
            <label htmlFor={'Attribute' + props.number}>Attribute {props.number}</label>
            <input type="text" className="form-control" name={'attribute' + props.number}/>
            <label htmlFor={'Value' + props.number}>Value {props.number}</label>
            <input type="text" className="form-control" name={'value' + props.number}/>
            <label htmlFor={'attribute_sort_order' + props.number}>Sort Order {props.number}</label>
            <input type="text" className="form-control" name={'attribute_sort_order' + props.number}/>
        </React.Fragment>
    )
}

export default Attribute
